(2,4)\n    ) \nAS \nT(a, b);\nCREATE PROCEDURE testdb15776.dbo.testproc13886()\nAS BEGIN\n  CREATE VIEW testdb15776.dbo.testview12752 \n  AS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \n  AS \n  T(a, b);\nEND;",
